css:
.header {
    border-width: 2px;
    padding: var(--spacer-2) var(--spacer-3);
    background-color: #171819;
}

main .header__nav a {
    color: #f3f3f3;
    border-bottom: 2px solid transparent;
}


element.style {
}
i[class*=" fa-"], i[class^=fa-] {
    -moz-osx-font-smoothing: grayscale;
    -webkit-font-smoothing: antialiased;
    display: inline-block;
    font-style: normal;
    font-variant: normal;
    text-rendering: auto;
    text-decoration: inherit;
    text-transform: none;
    line-height: 1;
    font-family: storefront-fa;
    font-weight: 400;
}
.header__toggler-icon {
    color: #ffffff;
    font-size: 1.3rem;
    margin-right: var(--spacer-1);
    margin-bottom: -.13rem;
}

.header__buttons .btn {
    padding: var(--spacer-2);
    margin-left: var(--spacer-1);
    color: #ffffff;
    transition: color .2s;
    box-shadow: none;
    position: relative;
}

.top-bar {
    background: #ff6600;
    width: 100%;
}

main .top-bar {
    display: inline;
    flex-direction: column;
}

main .top-bar__nav {
    font-size: 0%;
}

.top-bar__nav {
    padding: 0px;
}
